package model.dhcp;

public class ConfigChung {
	String dns_update_style;
	String authorative;
	String log_facitily;
	String domain_name;
	String domain_name_servers;
	String default_lease_time;
	String max_lease_time;

	public ConfigChung() {
		// TODO Auto-generated constructor stub
	}

	public ConfigChung(String dns_update_style, String authorative,
			String log_facitily, String domain_name,
			String domain_name_servers, String default_lease_time,
			String max_lease_time) {
		super();
		this.dns_update_style = dns_update_style;
		this.authorative = authorative;
		this.log_facitily = log_facitily;
		this.domain_name = domain_name;
		this.domain_name_servers = domain_name_servers;
		this.default_lease_time = default_lease_time;
		this.max_lease_time = max_lease_time;
	}

	public String getDns_update_style() {
		return dns_update_style;
	}

	public void setDns_update_style(String dns_update_style) {
		this.dns_update_style = dns_update_style;
	}

	public String getAuthorative() {
		return authorative;
	}

	public void setAuthorative(String authorative) {
		this.authorative = authorative;
	}

	public String getLog_facitily() {
		return log_facitily;
	}

	public void setLog_facitily(String log_facitily) {
		this.log_facitily = log_facitily;
	}

	public String getDomain_name() {
		return domain_name;
	}

	public void setDomain_name(String domain_name) {
		this.domain_name = domain_name;
	}

	public String getDomain_name_servers() {
		return domain_name_servers;
	}

	public void setDomain_name_servers(String domain_name_servers) {
		this.domain_name_servers = domain_name_servers;
	}

	public String getDefault_lease_time() {
		return default_lease_time;
	}

	public void setDefault_lease_time(String default_lease_time) {
		this.default_lease_time = default_lease_time;
	}

	public String getMax_lease_time() {
		return max_lease_time;
	}

	public void setMax_lease_time(String max_lease_time) {
		this.max_lease_time = max_lease_time;
	}

}
